from typing import List
from collections import Counter


class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        ns, np = len(s), len(p)
        if ns < np:
            return []

        counter_p = Counter(p)
        counter_s = Counter()

        result = []

        for i in range(ns):
            counter_s[s[i]] += 1

            if i >= np:
                if counter_s[s[i - np]] == 1:
                    del counter_s[s[i - np]]
                else:
                    counter_s[s[i - np]] -= 1

            if counter_s == counter_p:
                result.append(i - np + 1)
        return result


